
import { useEffect, useRef, useState } from 'react'
import {AiOutlineArrowLeft,AiOutlineArrowRight} from 'react-icons/ai'
import {IoFastFoodSharp} from 'react-icons/io5'
import {PiBowlFoodFill} from 'react-icons/pi'
import Search from './Search';

import {MdEmojiFoodBeverage,MdFoodBank} from 'react-icons/md'
import {SiIfood} from 'react-icons/si'


export default function Carousel() {
  
let [index,setindex]= useState(0)

const slideRef = useRef();

const remove =() =>{
  slideRef.current.classList.remove("fade-anim")
}

useEffect(()=> {
  slideRef.current.addEventListener('animationend' , remove)
 startSlider();
},[]);

const startSlider = () =>{
  setInterval(() =>{
    nextClick();
  },3000);
}

  const prevClick=()=>{
  if(index>0)
  {
    setindex(index--)
  }
  else{
    setindex((images.length)-1)
  }

  }
const nextClick = ()=>{

  if(index<images.length){
    setindex(index++)
  }
  else if (index === images.length){
   
   index=0
  }

    slideRef.current.classList.add("fade-anim")
 
  }


   const images =[

    "data:image/jpeg;base64,",
      "data:image/jpeg;base64,"
      , 
     "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcShlZSQQLHhRIoluEtg0u8GZ7--xdEx0GX9NA&usqp=CAU"
      , 
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTyhrAbYUZvvL0m0jjajPRTWbCBwju0gTZyJA&usqp=CAU"
      ,
     "data:image/jpeg;base64,"
      ,
    "data:image/jpeg;base64,"
   ]

      return (
   <div ref={slideRef} className=" w-screen md:py-5 relative">
   <div className=' flex md:text-white md:gap-10 md:absolute md:left-[58rem]'>
    <SiIfood className='mt-[5rem]'
    size={50}/>
      <IoFastFoodSharp className='mt-[2rem]'
      size={50}/>
      <PiBowlFoodFill className='top-2'
       size={50}/>
      <MdEmojiFoodBeverage className='mt-[2rem]'
      size={50}/>
      <MdFoodBank className='mt-[5rem]'
      size={50}/>
  </div>
<div className='object-contain opacity-100 '>
  <img className='h-[30rem] rounded-lg  sm:w-10/12 md:w-7/12 mx-auto md:mx-[3rem] mt-[-5rem] md:mt-5'
   src={images[index]}>
 </img>
 </div>
 
   <Search/>
  <div className='w-11/12 mx-auto  md:w-[53.7rem] px-3 md:mx-3 flex justify-between justify-center items-center'>
     
    <button  className='p-1 mt-[-70vh] rounded-full shadow bg-white opacity-80 text-gray-800 hover:opacity-100'
    onClick={prevClick}
    ><AiOutlineArrowLeft  size={30}/></button>
   
    <button className='p-1 mt-[-70vh] rounded-full shadow bg-white opacity-80 text-gray-800 hover:opacity-100'
    onClick={nextClick} 
    ><AiOutlineArrowRight size={30}/></button>
    </div>


    </div>
  )
}


